import React from "react";
import NavBarAction from "../components/NavBarAction";
import "./Equipment.less";

import on from "../assets/images/on.png";
import off from "../assets/images/off.png";
import SlotBox from "../components/SlotBox";


import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';

const Equipment = function Equipment(): JSX.Element {
  const controlData = [
    {
      id: 1,
      status: 1,
      title: "摄像头",
    },
    {
      id: 2,
      status: 0,
      title: "补光灯",
    },
    {
      id: 3,
      status: 1,
      title: "传感器",
    },
    {
      id: 4,
      status: 0,
      title: "排气扇",
    },
    {
      id: 5,
      status: 1,
      title: "灌溉器",
    },
  ];

  function createData(name: string, calories: number, fat: number, carbs: number, protein: number) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

  return (
    <div className="equipment-box">
      <NavBarAction title="设备管理" />
      <div className="content">
        <div className="data">
          <div className="dataItem">
            <p>
              <span className="num">65</span>个
            </p>
            <p>设备总数</p>
          </div>
          <div className="dataItem">
            <p>
              <span className="num">64</span>个
            </p>
            <p>设备正常数</p>
          </div>
          <div className="dataItem">
            <p>
              <span className="num">1</span>个
            </p>
            <p>设备异常数</p>
          </div>
        </div>
        <div className="control">
          <SlotBox title="设备管理">
            <div className="controlItems">
              {controlData.map((item) => {
                return (
                  <div className="controlItem" key={item.id}>
                    <img src={item.status === 1 ? on : off} alt="" />
                    <p>{item.title}</p>
                  </div>
                );
              })}
            </div>
          </SlotBox>
        </div>
        <div className="status">
          <SlotBox title="设备状态">
            <table>
              <thead>
                  <tr></tr>
              </thead>
            </table>
          </SlotBox>
        </div>
      </div>
    </div>
  );
};

export default Equipment;
